  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

function App() {
  return (
    <Switch>
    <Route path="/about">
      <PokeList />
    </Route>
    <Route exact path="/pokemon/:id" component={PokeFind}>

    </Route>
    <Route path="/">
      <Home />
    </Route>
  </Switch>
  );
}

export default App;
